import React from "react";
import BarMain from "../BarMain";

const Contact = () => {
  const blogItems = [
    {
      id: 1,
      title: "تواصل معنا",
    },
  ];

  return (
    <div className="contact-us">
      <div className="main">
        <div className="container">
          <BarMain items={blogItems} />
          <div className="title">
            <h1>كيف يمكننا مساعدتك؟</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
